Evacuate Earth: Series 1

Science Documentary hosted by Allan Corduner, published by National Geographic in 2013 - English narration


Information
------------------------------

Evacuate Earth: Series 1
The Survivor's Guide to the Mayan Apocalypse: What would we do if the world was about to end? Explore the technologies that could carry us to safety and help the human race begin again. In a doomsday scenario, the race is on to escape annihilation.


1)  Evacuate Earth 
If we had 75 years warning, would humankind be capable of evacuating the planet? This programme examines how you could flee your home habitat: from building a 25km-long spaceship capable of travelling trillions of kilometres to deciding which unlucky souls get left behind.

2)  Micro Monsters 
If we faced a countdown to destruction, could we find a way to survive? In a series of terrifying scenarios, Nat Geo explores how we could unite to ensure the survival of the human race.

3)  Monster Storm 
Could humanity survive if the planet were ravaged by a bizarre and deadly weather phenomenon? There may be hope if we can adapt to a new Earth.

4)  Flooded Earth 
Explore the terrifying consequences of flash floods and rising sea levels as experts explain how a massive volume of water might come to earth from space.

5)  Zombie Earth 
Is a zombie apocalypse simply a concept of fiction or could an infectious disease actually turn humanity into a race of vicious monsters? The truth just might shock you!

6)  Hell on Earth 
What would happen if all of the world's volcanoes erupted at the same time? Explore the very real, and very deadly, science of volcanic activity.

7)  Frozen Earth 
What might happen if a strange dark force pulls earth from its orbit and sends us drifting out into the deadly darkness of space?

